(931, 1000, 'OCORRENCIA:Sistema n°1 parado CAUSA: Retorno de água. SOLUCAO:Sr\'s. Boa tarde!\nFoi realizada a manutenção do conjunto de coloração n°1, pois na solicitação do cliente havia a informação de que o sistema estava parado pelo fato de ter retornado água para a reguladora. Após a limpeza da reguladora de pressão, injetor e rotametro também foi instalada uma válvula de retenção para evitar que tal fato voltasse a acontecer e logo após tal procedimento foi contatado que o injetor n°1 não funcionava. Mesmo trocando os O\'rings ele continuou sei gerar o vácuo necessário, foi então que utilizei um injetor reserva, só que com capacidade para 100kg/dia. E o mesmo funcionou normalmente como todo o sistema.  PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
