(1003, 1095, 'OCORRENCIA: preventiva CAUSA: SOLUCAO: realizada a manutenção nos cloradores de 2000LB,também realizada a limpeza dos rotâmetrose da haste do Clorador,feita a troca dos Oring\'s que se encontrava desgastado PECAS: ALIMENTACAO: 1reifeiçãoHOSPEDAGEM: ETC:'),
(1004, 1116, 'Encontramos o sistema operando parcialmente,com possível resíduo de água no sistema de cloração.\nrealizamos lavagem e secagem de monifold e válvulas R-0,limpeza nas válvulas reguladoras de pressão, limpeza e troca de oring\'s de injetores e pintura de todo sistema.\nFinalizado com o sistema operando normalmente.'),
(1005, 1081, 'OCORRENCIA: Equipamento parado.CAUSA: SOLUCAO: Após realizar a troca dos conectores das mangueiras da válvula reguladora de pressão e do rotâmetro, efetuei a troca de um dos injetores que era de 270 kg/dia para um de 100kg/dia após verificar que mesmo com a nova linha de alimentação de água que foi instalada não era possível gerar o vácuo necessário para acionar o sistema, baseado na informação do operador do horário eles dosam 24kg/dia. Após a intervenção o sistema ficou em pleno funcionamento.: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1006, 1110, 'OCORRENCIA: Equipamento parado. CAUSA: SOLUCAO: O atendimento foi realizado e o sistema voltou a sua normalidade: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1007, 1079, 'OCORRENCIA: Nova Instalação. Porém o novo sistema encontra-se sem atividade, pois a pressão da alimentação de água não foi suficiente para gerar o vácuo necessário. Por isso ficou acordado com os Sr\'s Saulo e Washington que eles iriam providenciar uma alimentação adequada e confeccionar uma base para assim poderem fazer a instalação da bomba Schneider de 3cv e só depois disso é que irão entrar em contato para que eu possa dar continuidade ao processo de implantação do Novo sistema. Foi realizada uma manobra para que o sistema deles continuasse com seu funcionamento normal.: SOLUCAO: PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1008, 1060, 'OCORRENCIA: Nova Instalação. O sistema havia sido instalado, faltando apenas o injetor. Quando por ordem superior, o mesmo teve que ser desmontado. CAUSA: SOLUCAO: PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1009, 1061, 'OCORRENCIA: Nova Instalação. Ficando acertado que o cliente Compesa, através do Sr\'s. Saulo coordenador e Washington irão fazer a instalação da bomba Schneider de 3cv pois ainda não havia a alimentação elétrica necessária, mas como a pressão de água é oriunda da adutora o equipamento ficou em pleno funcionamento ou seja 100%. : SOLUCAO: PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1010, 1115, 'OCORRENCIA: Sistema parado CAUSA:  Entrada de cloro liquido,Flexível obstruído e com extremidade desgastada SOLUCAO:  Realizei limpeza em válvula Reguladora de vácuo,Rotâmetro ,e também substitui o flexível juntamente com a válvula R/0 PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1011, 965, 'OCORRENCIA:Nova Instalação. Esta estação ainda não possui o sistema de cloração com gás, por esse motivo o novo sistema que foi instalado ainda não está em funcionamento, pois será necessário a inclusão de um ponto de água e outro de energia elétrica tanto para a bomba quanto para o detector de cloro.\n\nObs: Houve uma certa demora na instalação desse sistema devido a uma obstrução na porta de acesso da sala de coloração, como pode ser visto em uma das imagens havia uma  caixa d\'água contendo uma grande quantidade de hípica. O químico responsável, Sr. Anderson já está Ciente. CAUSA: SOLUCAO: PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1012, 1074, 'OCORRENCIA:  Sistema de cloração parado CAUSA: Injetor com o diafragma fadigado  SOLUCAO:  Realizei limpeza e manutenção em reguladora de vácuo,válvula R/0,substitui o disfragma,e também apliquei pintura em todo o sistema de cloração.\nAo término da manutenção e limpeza o sistema foi testado com êxito na presença do operador onde permaneceu em funcionamento. PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1013, 1043, 'OCORRENCIA: Ativação do sistema de cloração CAUSA:  Noa instalação de sitema de cloro SOLUCAO: Ativei,e dei treinamento ao operador  na presença do encarregado da CAERN Sr. Leandro.\nAo término do treinamento o sistema de cloração foi testado com êxito onde permaneceu em funcionamento. PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1014, 1019, 'OCORRENCIA: Solicitação da CAERN CAUSA: Sistema montado por outra empresa não atende a demanda do cliente SOLUCAO: A equipe da CAERN  focou a combina com a empresa responsável PECAS: ALIMENTACAO: HOSPEDAGEM: ETC:'),
(1015, 929, 'OCORRENCIA: preventivaCAUSA: SOLUCAO: foi realizada a integração no dia 09/08/18 e dado continuidade das atividades no dia 10/08/18 feita a pintura do Clorador dias tech A300 , substituição da bobina e  válvula , limpeza do tanque ,, realizada também a troca dos Oring\'s do equipamento T5,e feita a limpeza do tanque e pintura das tubulações.PECAS:AlimentçAO: HOSPEDAGEM: ETC:'),
