(2215, 2153, 'OCORRÊNCIA: Oscilação em aplicação de cloro em injetor 1. CAUSA: Mola do assento da esfera, e o\'ringue de retenção do dreno.  SOLUÇÃO: Reparado a mola e substituído a o\'ringue.  PECAS: da Retenção do dreno. O\'ringue. ALIMENTAÇÃO: HOSPEDAGEM: ETC:'),
