(2235, 2183, 'OCORRENCIA: CAUSA: SISTEMA NÃO ESTAVA OPERANDO. ETA ESTAVA COM DUAS BOMBAS DANIFICADAS COM ROLAMENTOS DEFEITUOSOS. A ÁGUA VINDO DO RESERVATÓRIO ESTAVA COM BASTANTE AREIA VINDO DE UM FILTRO DANIFICANDO AS BOMBAS CENTRIFUGAS. O COORDENADOR DA CAGECE SR. RAISON FICOU DE REALIZAR A RETIRADA DA AREIA DO RESERVATÓRIO E FICAMOS DE RETORNAR NO PRÓXIMO DIA PARA FINALIZAR A MANUTENÇÃO. NO DIA SEGUINTE FINALIZAMOS A MANUTENÇÃO COM TROCA DE BOMBAS,TROCADO UM INJETOR,TROCADO UMA VÁLVULA DE 3/4, UMA UNIÃO DE 3/4,E ORINGS DE UM INJETOR. SISTEMA \n FICOU OPERANDO NORMALMENTE/PECAS: QUATO ROLAMENTOS E DOIS SELOS DAS BOMBAS.'),
